(86, 3, '2019-06-22 17:12:34', '2019-06-22 17:12:34', '<strong>News Tirumala:</strong>\r\n\r\nAndhra Pradesh Chief Minister YS Jagan Mohan Reddy appointed Mr. YV Subba Reddy as a Chairman for Tirumala Tirupati Devasthanams Board (TTD).\r\n\r\nYV Subba Reddyâ€™s took charge on Saturday at 11 AM as TTD Board Chairman in Tirumala after the resignation of former TTD chairman Putta Subhakar Reddy, who was appointed by the Chandrababu Naidu- Former CM of Andhra Pradesh and led Telugu Desam Party (TDP) government.\r\n\r\nTirumala Tirupati Devasthanams is one of the biggest Trust body in India, Which takes complete management of the Tirumala Venkateswara Temple, richest Hindhu temple in the world. And TTD Board organize various festivals and event in Tirumala Temple and Temple in Tirupati which associates with TTD.\r\n\r\nThe TTD chairmanship holds a largest demand in Andhra Pradesh, and Government of Andhra Pradesh appoint and operate the Board of TTD Trust. People in Local bodies and finacial supporters of AP Govt would have more chance to get opportunity in this Board.\r\n\r\nYV Subba Reddy, who is also party general secretary, won as YSRCP MP from Ongole, Prakasam district, in the 2014 national elections.\r\n\r\nAs per sources, the newly elected YCP government has looking to form complete Governing Council of the temple and a new management within four days.', 'TTD New Chairman Takes Charge', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2019-06-22 17:12:34', '2019-06-22 17:12:34', '', 84, 'https://tenn24.com/84-revision-v1/', 0, 'revision', '', 0),
(87, 3, '2019-06-23 17:39:22', '2019-06-23 17:39:22', '<strong>The game changing 29th over</strong>\r\n\r\nAfter restricting india for 224 turns with their bowling brilliance, Afghanistan has laid a strong foundation in their run chase too with 106runs for lose of 2 wickets after 27 overs and were 118 runs away for a mega upsets of the tournament. The game is well poised towards Afghan and it seemed to be a history at making. With two set batsman Rahmat at 36 (59)and shahidi at 21 (43)\r\n\r\nBut, bumrah in 29th over (2nd over of his second spell) of the innings has once again stood up to his captains expectations with double strokes and a maiden over.\r\nFirst ball itself is an LBW but the umpire was not convinced with it then comes 2 more dot balls making the batsmen Rahmat uncomfortable and then comes the short Ball with bumrahs timing trick forced Rahmat for a pull shot with a top edge and Chahal has collected a diving catch.\r\nShahidi comes to crease as both the batsmen crossed each other before the catch.\r\n\r\nShahidi then had a dot ball but has failed to with stand the magic of bumrah in the last ball, I.e., short of the length, right into the body. Batman hops at the ball and closes the bat face as there pops the leading edge and bumrah himself manages to run and pick a low catch on the pitch\r\n\r\nBumrah has put halt to the Afghan momentum in just one over by dismissing 2 set batsman. India managed to win the match by 11 runs and bumrah for his bowling brilliance trough out (10 overs-39 runs-2 wickets) was awarded with man of the match.', 'Bumrah twin strokes', '', 'publish', 'open', 'open', '', 'bumrah-twin-strokes', '', '', '2019-06-24 12:38:17', '2019-06-24 12:38:17', '', 0, 'https://tenn24.com/?p=87', 0, 'post', '', 0),
(88, 3, '2019-06-23 17:38:12', '2019-06-23 17:38:12', '', 'Bumrah123', '', 'inherit', 'open', 'closed', '', 'bumrah123', '', '', '2019-06-23 17:38:12', '2019-06-23 17:38:12', '', 87, 'https://tenn24.com/wp-content/uploads/2019/06/Bumrah123.jpg', 0, 'attachment', 'image/jpeg', 0),
(89, 3, '2019-06-23 17:39:22', '2019-06-23 17:39:22', '<strong>The game changing 29th over</strong>\r\n\r\nAfter restricting india for 224 turns with their bowling brilliance, Afghanistan has laid a strong foundation in their run chase too with 106runs for lose of 2 wickets after 27 overs and were 118 runs away for a mega upsets of the tournament. The game is well poised towards Afghan and it seemed to be a history at making. With two set batsman Rahmat at 36 (59)and shahidi at 21 (43)\r\n\r\nBut, bumrah in 29th over (2nd over of his second spell) of the innings has once again stood up to his captains expectations with double strokes and a maiden over.\r\nFirst ball itself is an LBW but the umpire was not convinced with it then comes 2 more dot balls making the batsmen Rahmat uncomfortable and then comes the short Ball with bumrahs timing trick forced Rahmat for a pull shot with a top edge and Chahal has collected a diving catch.\r\nShahidi comes to crease as both the batsmen crossed each other before the catch.\r\n\r\nShahidi then had a dot ball but has failed to with stand the magic of bumrah in the last ball, I.e., short of the length, right into the body. Batman hops at the ball and closes the bat face as there pops the leading edge and bumrah himself manages to run and pick a low catch on the pitch\r\n\r\nBumrah has put halt to the Afghan momentum in just one over by dismissing 2 set batsman. India managed to win the match by 11 runs and bumrah for his bowling brilliance trough out (10 overs-39 runs-2 wickets) was awarded with man of the match.', 'Bumrah twin strokes', '', 'inherit', 'closed', 'closed', '', '87-revision-v1', '', '', '2019-06-23 17:39:22', '2019-06-23 17:39:22', '', 87, 'https://tenn24.com/87-revision-v1/', 0, 'revision', '', 0),
(116, 3, '2019-06-24 08:16:54', '2019-06-24 08:16:54', '<h2>AP Jobs..</h2>\nPanchayat raj Deparment of Government of Andhra Pradesh in the leadership of Sri Y.S. Jagan Mohan Reddy has released notification for the recruitment of Grama Volunteers in 13 districts of Andhra Pradesh.\n\nChief Minister on the day of taking oat has promised to fulfill his election promise of creating Grama Volunteer jobs by 15<sup>th</sup> August 2019. To revamp delivery systems in the State with an aim to improve living standards of the people , Government intends to deploy Volunteers in rural areas for delivering Government Services at door step of all eligible households irrespective of Caste/Creed/Religion/Gender and political affiliation. This system will ensure leak proof implementation of Government Programs/Schemes. The objective of positioning Village Volunteers is to ensure timely and transparent services, to eliminate the corruption at all levels of administration. Village Volunteers will identify the problems being faced by anybody in his jurisdiction and the same will be brought to the notice of Gram Panchayat and then get them resolved. Applicants within the age group of 18 to 35 years were eligible and minimum education qualification is intermediate and 10<sup>th</sup> class in tribal areas/ agencies. 50% of posts in each category is reserved for woman. An honorarium of 5000/- per month per volunteer will be paid. This program costs 1200cr per annum towards honorarium and 13.5 crores towards training and recruitment process.\n<h5>Time line for selection</h5>\nReceipt of application Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  24-06-2019 to 05-07-2019\nScrutiny of applications Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  10-07-2019\nInterviews by Selection Committee Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  11-07-2019 to 25-07-2019\nIntimation letters to selected Volunteers. Â Â Â Â Â Â Â Â Â Â  01-08-2019\nInduction and training programÂ  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  Â  05-08-2019 to 10-08-2019\npositioning of volunteers Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â Â  15-08-2019\n<h5>To apply please click here</h5>\n<a href="http://gramavolunteer.ap.gov.in/GRAMAVAPP/VV/index.html">http://gramavolunteer.ap.gov.in/GRAMAVAPP/VV/index.html</a>\n<h5>To check the notification please check here</h5>\n<a href="http://gramavolunteer.ap.gov.in/GRAMAVAPP/Links/GO.pdf">http://gramavolunteer.ap.gov.in/GRAMAVAPP/Links/GO.pdf</a>', 'Grama/ ward volunteer jobs in Andhra Pradeshâ€¦!', '', 'inherit', 'closed', 'closed', '', '113-autosave-v1', '', '', '2019-06-24 08:16:54', '2019-06-24 08:16:54', '', 113, 'https://tenn24.com/113-autosave-v1/', 0, 'revision', '', 0),
(118, 3, '2019-06-24 08:17:27', '2019-06-24 08:17:27', '<h2>AP Jobs..</h2>\r\nPanchayat raj Deparment of Government of Andhra Pradesh in the leadership of Sri Y.S. Jagan Mohan Reddy has released notification for the recruitment of Grama Volunteers in 13 districts of Andhra Pradesh.\r\n\r\nChief Minister on the day of taking oat has promised to fulfill his election promise of creating Grama Volunteer jobs by 15<sup>th</sup> August 2019. To revamp delivery systems in the State with an aim to improve living standards of the people , Government intends to deploy Volunteers in rural areas for delivering Government Services at door step of all eligible households irrespective of Caste/Creed/Religion/Gender and political affiliation. This system will ensure leak proof implementation of Government Programs/Schemes. The objective of positioning Village Volunteers is to ensure timely and transparent services, to eliminate the corruption at all levels of administration. Village Volunteers will identify the problems being faced by anybody in his jurisdiction and the same will be brought to the notice of Gram Panchayat and then get them resolved. Applicants within the age group of 18 to 35 years were eligible and minimum education qualification is intermediate and 10<sup>th</sup> class in tribal areas/ agencies. 50% of posts in each category is reserved for woman. An honorarium of 5000/- per month per volunteer will be paid. This program costs 1200cr per annum towards honorarium and 13.5 crores towards training and recruitment process.\r\n<h5>Time line for selection</h5>\r\n<table dir="ltr" style="height: 251px;" border="1" width="630" cellspacing="0" cellpadding="0"><colgroup><col width="242" /><col width="161" /></colgroup>\r\n<tbody>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Receipt of application &quot;}">Receipt of application</td>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;24-06-2019 to 05-07-2019&quot;}">24-06-2019 to 05-07-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Scrutiny of applications &quot;}">Scrutiny of applications</td>\r\n<td data-sheets-value="{&quot;1&quot;:3,&quot;3&quot;:43745}" data-sheets-numberformat="{&quot;1&quot;:5,&quot;2&quot;:&quot;mm-dd-yyyy&quot;,&quot;3&quot;:1}">10-07-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Interviews by Selection Committee &quot;}">Interviews by Selection Committee</td>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;11-07-2019 to 25-07-2019&quot;}">11-07-2019 to 25-07-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Intimation letters to selected Volunteers. &quot;}">Intimation letters to selected Volunteers.</td>\r\n<td data-sheets-value="{&quot;1&quot;:3,&quot;3&quot;:43473}" data-sheets-numberformat="{&quot;1&quot;:5,&quot;2&quot;:&quot;mm-dd-yyyy&quot;,&quot;3&quot;:1}">01-08-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;Induction and training program &quot;}">Induction and training program</td>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;05-08-2019 to 10-08-2019&quot;}">05-08-2019 to 10-08-2019</td>\r\n</tr>\r\n<tr>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;positioning of volunteers &quot;}">Positioning of volunteers</td>\r\n<td data-sheets-value="{&quot;1&quot;:2,&quot;2&quot;:&quot;15-08-2019&quot;}">15-08-2019</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<h5>To apply please click here</h5>\r\n<a href="http://gramavolunteer.ap.gov.in/GRAMAVAPP/VV/index.html">http://gramavolunteer.ap.gov.in/GRAMAVAPP/VV/index.html</a>\r\n<h5>To check the notification please check here</h5>\r\n<a href="http://gramavolunteer.ap.gov.in/GRAMAVAPP/Links/GO.pdf">http://gramavolunteer.ap.gov.in/GRAMAVAPP/Links/GO.pdf</a>', 'Grama/ ward volunteer jobs in Andhra Pradeshâ€¦!', '', 'inherit', 'closed', 'closed', '', '113-revision-v1', '', '', '2019-06-24 08:17:27', '2019-06-24 08:17:27', '', 113, 'https://tenn24.com/113-revision-v1/', 0, 'revision', '', 0),
